import React from "react";
import { Component } from "react";

import blog from './resources/images/blog.jpg';
import diary from './resources/images/diary.jpg';
import laptop from './resources/images/laptop.jpg';
import web_design from './resources/images/web-design.jpg';


const Carousel = () => {
    return (
        <div>
            <div id="carousel" className="carousel slide" data-bs-ride="carousel">
                <div className="carousel-inner">
                    <div className="carousel-item active" data-bs-interval="3000">
                        <img className="d-block w-100" src={blog} alt="First slide" height="400" />
                    </div>

                    <div className="carousel-item" data-bs-interval="3000">
                        <img className="d-block w-100" src={diary} alt="Second slide" height="400" />
                    </div>

                    <div className="carousel-item" data-bs-interval="3000">
                        <img className="d-block w-100" src={laptop} alt="Third slide" height="400" />
                    </div>

                    <div className="carousel-item" data-bs-interval="3000">
                        <img className="d-block w-100" src={web_design} alt="Fourth slide" height="400" />
                    </div>

                </div>

            </div>
        </div>
    )
}

export default Carousel
